import logo from './images/logo.svg';

// Works "../src/logo192moved.png"
import airBnB_Image_path from "./images/airbnb-logo.png";
import Online_Experiences_Image_path from "./images/photo-grid.png";

function Navbar() {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <img src={airBnB_Image_path} className="nav--icon" />
            <h3 className="nav--logo_text">ReactFacts</h3>
            <h4 className="nav--title">React Course - Project 1</h4>
        </nav>
    )
}


function OnlineExperiences() {
    return (
        <>
        <img src={Online_Experiences_Image_path} className="nav--icon" />
        </>
    )
}

export default function Header() {
    return (
    <div>
       <Navbar />
       <OnlineExperiences />
    </div>
    )
  }
